import React, { Component } from 'react';
import Header from './Header';
import Inventory from './Inventory';
import Order from './Order';

class Store extends Component {
    render() {
        return (
            <div classname="Catch-Of-the-day">
                <div classname="menu">
                    <Header/>
                </div>
                <Inventory />
                <Order />
            </div>
        );
    }
}

export default Store;
